window.bookSummaryJSON = "<p>Disguised as a boy, Alanna of Trebond becomes a squire—to none other than the prince of the realm. But Prince Jonathan is much more to Alanna; he is her ally, her best friend, and one of the few who knows that she's really a girl. </p> <p>Now it will take all of Alanna's awesome skill, strength, and growing magical powers to protect him from the mysterious evil sorcerer who is bent on his destruction—and hers! </p> <p>Here continues the story of Alanna, a young woman bound for glory who is willing to fight against enormous odds for what she believes in.</p>"; 
